import sys
import random
from Crypto.Util.number import *
flag = b"SF24{REDACTED}"

e = 65537
n = 1
plist = []
for i in range(100):
    p = getPrime(25)
    if not (p in plist):
        plist.append(p)

for i in plist:
    n *= i

c = pow(bytes_to_long(flag), e, n)
print("n = "+ str(n))
print("e = "+ str(e))
print("c = "+ str(c))


